<div class="lightbox-wrapper"><a class="lightbox" href="https://www.chiefdelphi.com/uploads/default/original/3X/5/7/574e39936e90f1fd9b27781daf8d5a786eaf85d9.png" data-download-href="https://www.chiefdelphi.com/uploads/default/574e39936e90f1fd9b27781daf8d5a786eaf85d9" title="image"><img src="https://www.chiefdelphi.com/uploads/default/original/3X/5/7/574e39936e90f1fd9b27781daf8d5a786eaf85d9.png" alt="image" data-base62-sha1="csl8qQEwVu4pWJDvLCxeLmRaE53" width="381" height="500" data-dominant-color="353535"><div class="meta"><svg class="fa d-icon d-icon-far-image svg-icon" aria-hidden="true"><use href="#far-image"></use></svg><span class="filename">image</span><span class="informations">852×1116 10.1 KB</span><svg class="fa d-icon d-icon-discourse-expand svg-icon" aria-hidden="true"><use href="#discourse-expand"></use></svg></div></a></div><br>
We didn’t see any exceptions. It seems the robot code did not load and it kept doing it over and over again. BTW, we have the latest WPILib installed and the RoboRio with the latest image. At first, we thought it’s our code but I just tried “create a new project” either a Timed Robot Skeleton or a RobotBase skeleton, it’s the same result. So, it’s not our code. Any quick suggestions before I dive into debugging this? I searched past postings and found one two years ago but one major difference was they had an exception loading the robot code and we don’t see any. Peter Johnston replied that post about build.properties being wrong. But there is no such file in our project. I think it’s because we changed over to gradle build. I checked gradle.build and it is pointing to the correct robot MAIN object. BTW, we identified this output was printed by the code in RobotBase.java.</p>","post_number":1,"post_type":1,"posts_count":26,"updated_at":"2023-01-16T08:35:33.046Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":318,"reads":186,"readers_count":185,"score":1627.2,"yours":false,"topic_id":423377,"topic_slug":"problem-loading-robot-code","display_username":"mikets","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":2,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"link_counts":[{"url":"https://www.chiefdelphi.com/uploads/default/original/3X/5/7/574e39936e90f1fd9b27781daf8d5a786eaf85d9.png","internal":true,"reflection":false,"clicks":0}],"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":13461,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/problem-loading-robot-code/423377/1","