-16T12:41:07.201Z","cooked":"<p>Strange. Seeing the “** Robot program starting…” message indeed means that something based on <code>RobotBase</code> is created and started. In case of an error, you should see a stack trace, unless you somehow end up calling <code>System.exit(..)</code> to simply quit without error, but unclear how that would happen with the RobotBase skeleton.</p>","post_number":3,"post_type":1,"posts_count":26,"updated_at":"2023-01-16T12:41:07.201Z","reply_count":1,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":144,"readers_count":143,"score":33.8,"yours":false,"topic_id":423377,"topic_slug":"problem-loading-robot-code","display_username":null,"primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":38843,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/problem-loading-robot-code/423377/3","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3127394,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2023-01-16T13:26:02.373Z","cooked":"<p>There may be two issues in play here.</p>
