<p>package frc.robot;</p>
<p>import edu.wpi.first.hal.DriverStationJNI;<br>
import edu.wpi.first.util.WPIUtilJNI;<br>
import edu.wpi.first.wpilibj.DriverStation;<br>
import edu.wpi.first.wpilibj.RobotBase;<br>
import edu.wpi.first.wpilibj.internal.DriverStationModeThread;</p>
<p>/**</p>
<ul>
<li>The VM is configured to automatically run this class. If you change the name of this class or the</li>
<li>package after creating this project, you must also update the build.gradle file in the project.<br>
*/<br>
public class Robot extends RobotBase {<br>
Robot()<br>
{<br>
super();<br>
System.out.println(“&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt; Create my RobotBase.&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt;”);<br>
}<br>
public void robotInit() {}</li>
</ul>
<p>public void disabled() {}</p>
<p>public void autonomous() {}</p>
<p>public void teleop() {}</p>
<p>public void test() {}</p>
<p>private volatile boolean m_exit;</p>
<p><a class="mention" href="/u/override">@Override</a><br>
public void startCompetition() {<br>
System.out.println(“&gt;&gt;&gt;&gt;&gt; About to run robotInit &lt;&lt;&lt;&lt;&lt;”);<br>
robotInit();<br>
System.out.println(“&gt;&gt;&gt;&gt;&gt; Done with robotInit &lt;&lt;&lt;&lt;&lt;”);</p>
<pre><code>DriverStationModeThread modeThread = new DriverStationModeThread();

int event = WPIUtilJNI.createEvent(false, false);

DriverStation.provideRefreshedDataEventHandle(event);

// Tell the DS that the robot is ready to be enabled
DriverStationJNI.observeUserProgramStarting();

while (!Thread.currentThread().isInterrupted() &amp;&amp; !m_exit) {
  System.out.printf("[%d]: Modes(disabled=%s,auto=%s,teleop=%s,test=%s\n",
      System.currentTimeMillis(), isDisabled(), isAutonomous(), isTeleop(), isTest());
  if (isDisabled()) {
    modeThread.inDisabled(true);
    disabled();
    modeThread.inDisabled(false);
    while (isDisabled()) {
      try {
        WPIUtilJNI.waitForObject(event);
      } catch (InterruptedException e) {
        Thread.currentThread().interrupt();
      }
    }
  } else if (isAutonomous()) {
    modeThread.inAutonomous(true);
    autonomous();
    modeThread.inAutonomous(false);
    while (isAutonomousEnabled()) {
      try {
        WPIUtilJNI.waitForObject(event);
      } catch (InterruptedException e) {
        Thread.currentThread().interrupt();
      }
    }
  } else if (isTest()) {
    modeThread.inTest(true);
    test();
    modeThread.inTest(false);
    while (isTest() &amp;&amp; isEnabled()) {
      try {
        WPIUtilJNI.waitForObject(event);
      } catch (InterruptedException e) {
        Thread.currentThread().interrupt();
      }
    }
  } else {
    modeThread.inTeleop(true);
    teleop();
    modeThread.inTeleop(false);
    while (isTeleopEnabled()) {
      try {
        WPIUtilJNI.waitForObject(event);
      } catch (InterruptedException e) {
        Thread.currentThread().interrupt();
      }
    }
  }
}

DriverStation.removeRefreshedDataEventHandle(event);
modeThread.close();
</code></pre>
